import React, { useContext, createContext, useState } from "react";
import '../Settings.css';

export default class FirstName extends React.Component {

  constructor(props){
    super(props);
    this.state = {
      prenom:'',
    }
      this.handleChange = this.handleChange.bind(this);
  }

  rechercher(e) {
    this.setState({prenom: e.target.value})
  }

  handleChange(event) {
    this.setState({value: event.target.value});
  }

  render() {
  return (
    <div>
      <div className="app-row" style={{margin: 0, padding: 0}}>

        <div className="app-col-xs-12 app-col-md-6 app-col-lg-6">

              <a className="info">First Name</a>
              <input type="text" placeholder="Saisissez votre recherche"/> {/*onChange={(e) => this.rechercher(e)} value={prenom}*/}

              <br />
              <br />

              <a className="info">LastName</a>
              <input type="text" placeholder="Saisissez votre recherche"/>
              {/*<input type="submit" value="Submit" /> onClick={() => this.props.parentCallback(this.state.prenom)}*/}
        </div>

        <br />
        <br />

        <div className="app-col-xs-12 app-col-md-6 app-col-lg-6">

            <form >
              <a className="info">Groupe</a>
              <label>
                <select value={this.state.value} onChange={this.handleChange}>
                  <option value="Vide"></option>
                  <option value="2A">2A</option>
                  <option value="2B">2B</option>
                  <option value="4A">4A</option>
                  <option value="4B">4B</option>
                </select>
              </label>
            </form>

            <form>
              <a className="info">Statut</a>
              <label>
                <select value={this.state.value} onChange={this.handleChange}>
                  <option value="Vide"></option>
                  <option value="Confirmed">Confirmed</option>
                  <option value="NotConfirmed">Not Confirmed</option>
                </select>
              </label>
              <input type="submit" value="Submit" />
            </form>

        </div>
    </div>
  </div>

  );
}
}
